import { Carousel } from 'react-bootstrap';
import image1 from './onlineshopping5.jpg';
import image2 from './onlineshopping2.jpg';
import image3 from './onlineshopping3.jpg';

function HomeSlideShow() {
  return (
    <Carousel data-bs-theme="dark" interval={500}>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={image1}
          alt="First slide"
          style={{ width: '100%', height: '300px', objectFit: 'cover' }}
        />
        <Carousel.Caption>
        <h5 style="color: #007bff;">Tritron E-Commerce</h5>

          <p>Shop Smart, Live Smart: Tritron E-Commerce Destination</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={image2}
          alt="Second slide"
          style={{ width: '100%', height: '300px', objectFit: 'cover' }}
        />
        <Carousel.Caption>
        <h5 style="color: #007bff;">Tritron E-Commerce</h5>

          <p>Empowering Your Shopping Experience: Where Convenience Meets Quality</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src={image3}
          alt="Third slide"
          style={{ width: '100%', height: '300px', objectFit: 'cover' }}
        />
        <Carousel.Caption>
        <h5 >Tritron E-Commerce</h5>

          <p>Discover, Explore, Shop: Unleash the Possibilities with Us</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
}

export default HomeSlideShow;
